- input: TEXT,F3XA,,"Response to letter dated June 24, 2005; period covered 11/23/04-12/31/04.  This
    response follows each bullet point.  All joint fundraising receipts have been
    entered as memo entries due to the filing of amended reports.  There are also
    timing differences in the filing of memo entries and the disbursement of funds
    from the joint fundraiser are paritally responsible for the differences.  The  references
    to SC Party Victory Fund relate to transfers in from DNC Services Corporation.  The
    Voter Participation Fund memo entries have been previously reported.  The Schedule
    F has been updated with the filing of amended reports.  The Levin account transfers
    have been clarifed by the filing of amended reports.  Schedules H2 and H4 have
    been changed to more accurately report two expenditures that are specific to a
    100% federal fundraising activity.  These expenditures are now reported on line
    21b.  Every effort is made to file accurate and timely reports with the Commission."
